import torch
from utils.utils import HadamardTransform


def get_hadK(n, transpose=False):
    hadK, K = None, None
    if n % 172 == 0:  # llama-2-7b up
        assert is_pow2(n // 172)

        K = 172
        hadK = get_had172().T if transpose else get_had172()
    elif n % 156 == 0:  # llama-1-30b 3x hidden
        assert is_pow2(n // 156)

        K = 156
        hadK = get_had156().T if transpose else get_had156()
    elif n % 140 == 0:  # llama-1-30b intermediate
        assert is_pow2(n // 140)

        K = 140
        hadK = get_had140().T if transpose else get_had140()
    elif n % 108 == 0:  # llama-1-13b intermediate
        assert is_pow2(n // 108)

        K = 108
        hadK = get_had108().T if transpose else get_had108()
    elif n % 60 == 0:  # llama-1-13b 3x hidden
        assert is_pow2(n // 60)

        K = 60
        hadK = get_had60().T if transpose else get_had60()
    elif n % 52 == 0:  # llama-1-13b 1x hidden
        assert is_pow2(n // 52)

        K = 52
        hadK = get_had52().T if transpose else get_had52()
    elif n % 36 == 0:
        assert is_pow2(n // 36)

        K = 36
        hadK = get_had36().T if transpose else get_had36()
    elif n % 28 == 0:
        assert is_pow2(n // 28)

        K = 28
        hadK = get_had28().T if transpose else get_had28()
    elif n % 44 == 0:
        assert is_pow2(n // 44)
        print("get_had_44")
        K = 44
        hadK = get_had44().T if transpose else get_had44()
    elif n % 40 == 0:
        assert is_pow2(n // 40)

        K = 40
        hadK = get_had40().T if transpose else get_had40()
    elif n % 20 == 0:
        assert is_pow2(n // 20)

        K = 20
        hadK = get_had20().T if transpose else get_had20()
    elif n % 12 == 0:
        assert is_pow2(n // 12)

        K = 12
        hadK = get_had12().T if transpose else get_had12()
    else:
        assert is_pow2(n)

        K = 1

    return hadK, K


def matmul_hadU(X, transpose=False):
    n = X.shape[-1]
    hadK, K = get_hadK(n, transpose)
    input = X.clone().view(-1, n, 1)
    output = input.clone()
    while input.shape[1] > K:
        input = input.view(input.shape[0], input.shape[1] // 2, 2, input.shape[2])
        output = output.view(input.shape)
        output[:, :, 0, :] = input[:, :, 0, :] + input[:, :, 1, :]
        output[:, :, 1, :] = input[:, :, 0, :] - input[:, :, 1, :]
        output = output.view(input.shape[0], input.shape[1], -1)
        (input, output) = (output, input)
    del output

    if K > 1:
        # Do not explicitly repeat - OOM
        # input = torch.bmm(
        #     hadK.repeat(len(input), 1, 1).to(input.device).to(input.dtype), input)
        # Use bcast instead
        input = hadK.view(1, K, K).to(input) @ input

    return input.view(X.shape) / torch.tensor(n).sqrt()


def matmul_hadUt(X):
    return matmul_hadU(X, transpose=True)


def random_hadamard_matrix(size, device):
    # See https://cornell-relaxml.github.io/quip-sharp/ , Section "Randomized Hadamard Transformation"
    Q = torch.randint(low=0, high=2, size=(size,)).to(torch.float64)
    Q = Q * 2 - 1
    Q = torch.diag(Q)
    return matmul_hadU(Q).to(device)


def hadamard_matrix(size, device):
    # See https://cornell-relaxml.github.io/quip-sharp/ , Section "Randomized Hadamard Transformation"
    Q = torch.eye(size)
    return matmul_hadU(Q).to(device)


def matmul_hadU_cuda(X, hadK, K):
    n = X.shape[-1]
    if K == 1:
        return HadamardTransform.apply(X.contiguous()) / torch.tensor(n).sqrt()
    # if transpose:
    #     hadK = hadK.T.contiguous()
    input = X.view(-1, K, n // K)
    input = HadamardTransform.apply(input.contiguous()) / torch.tensor(n).sqrt()
    input = hadK.to(input.device).to(input.dtype) @ input
    return input.reshape(X.shape)


def matmul_hadU_cuda_fsdp(X, hadK, K):
    # 记录原始状态
    is_dtensor = isinstance(X, DTensor)
    orig_device = X.device
    orig_dtype = X.dtype
    
    # 1. 如果是 DTensor，先安全地转换为普通本地 Tensor
    if is_dtensor:
        # redistribute 为 Replicate 会触发 All-gather，确保当前卡拿到完整数据
        # 这是数学正确执行 Hadamard 变换的前提
        X_local = X.redistribute(X.device_mesh, [Replicate()]).to_local()
    else:
        X_local = X

    n = X_local.shape[-1]
    
    # 2. 执行核心计算（在普通 Tensor 上执行，避开 DTensor Dispatch 错误）
    if K == 1:
        # 确保 contiguous()，防止 CUDA 核函数访问非法地址
        input_data = X_local.contiguous()
        output = HadamardTransform.apply(input_data) / torch.sqrt(torch.tensor(n, device=orig_device, dtype=orig_dtype))
    else:
        # 分块逻辑
        input_reshaped = X_local.reshape(-1, K, n // K).contiguous()
        input_transformed = HadamardTransform.apply(input_reshaped) / torch.sqrt(torch.tensor(n, device=orig_device, dtype=orig_dtype))
        
        hadK = hadK.to(device=orig_device, dtype=orig_dtype)
        output = torch.matmul(hadK, input_transformed)
        output = output.reshape(X_local.shape)

    # 3. 如果原本是 DTensor，将结果包装回去并恢复分片状态
    if is_dtensor:
        from torch.distributed.tensor import distribute_tensor
        # 先包装为全量 DTensor
        output_dt = distribute_tensor(output, X.device_mesh, [Replicate()])
        # 再还原回原本的分片方式 (如 Shard(0))，这一步会触发 Reduce-Scatter 确保显存均衡
        return output_dt.redistribute(X.device_mesh, X.placements)
    
    return output

def matmul_hadUt_cuda(X, hadK, K):
    return matmul_hadU_cuda(X, hadK, K, transpose=True)

def apply_exact_had_to_linear(module, had_dim=-1, output=False, R2=None):
    from torch.distributed.tensor import DTensor, Replicate
    assert isinstance(module, torch.nn.Linear)
    in_features, out_features = module.in_features, module.out_features

    # 检查 Hadamard 维度
    if had_dim != -1:
        assert is_pow2(had_dim), "Hadamard dimension must be a power of 2!"

    # --- 处理权重 ---
    W_orig = module.weight.data
    is_dtensor = isinstance(W_orig, DTensor)
    if is_dtensor:
        # 全量 gather 到本地 Tensor
        W = W_orig.redistribute(W_orig.device_mesh, [Replicate()]).to_local()
    else:
        W = W_orig

    dtype = W.dtype
    dev = W.device

    W = W.float().cuda()  # 做计算用 float CUDA

    # --- Hadamard 变换 ---
    if had_dim == -1:
        if output:
            had_K, K = get_hadK(out_features)
            W = matmul_hadU_cuda(W.t(), had_K, K).t()
        else:
            had_K, K = get_hadK(in_features)
            W = matmul_hadU_cuda(W, had_K, K)
    else:
        hadK = hadamard_matrix(had_dim, "cuda").to(torch.float64)
        if R2 is not None:
            hadK = R2.to(torch.float64)

        if output:
            W = W.t()
            transposed_shape = W.shape
            temp = W.reshape(-1, transposed_shape[-1] // had_dim, had_dim)
            temp = temp.to(torch.float64) @ hadK
            W = temp.reshape(transposed_shape).t()
        else:
            init_shape = W.shape
            temp = W.reshape(-1, init_shape[-1] // had_dim, had_dim)
            temp = temp.to(torch.float64) @ hadK
            W = temp.reshape(init_shape)

    # --- 转回 DTensor（如果原本是 DTensor） ---
    if is_dtensor:
        from torch.distributed.tensor import distribute_tensor
        W = distribute_tensor(W, W_orig.device_mesh, [Replicate()])
        W = W.redistribute(W_orig.device_mesh, W_orig.placements)

    # 恢复原 dtype 和 device
    module.weight.data = W.to(device=dev, dtype=dtype)


def is_pow2(n):
    return (n & (n - 1) == 0) and (n > 0)


